import React from "react";

import classes from "./KeysList.module.css";

const KeysList = () => {
  return (
    <ul className={classes.keys__list}>
      <li className={classes.key}>
        <span className={classes.key__text}>Testnet</span>
        <button className={classes.btn__icon}>
          <ion-icon
            className={classes.key__delete}
            name="close-outline"
          ></ion-icon>
        </button>
      </li>
    </ul>
  );
};

export default KeysList;
